INSERT INTO `ck_editor` VALUES ('8a8ab0b246dc81120146dc81847a013a','<html><head><title></title><link href=\'plug-in/easyui/themes/default/easyui.css\' id=\'easyuiTheme\' rel=\'stylesheet\' type=\'text/css\' /><link href=\'plug-in/easyui/themes/icon.css\' rel=\'stylesheet\' type=\'text/css\' /><link href=\'plug-in/accordion/css/accordion.css\' rel=\'stylesheet\' type=\'text/css\' /><link href=\'plug-in/Validform/css/style.css\' rel=\'stylesheet\' type=\'text/css\' /><link href=\'plug-in/Validform/css/tablefrom.css\' rel=\'stylesheet\' type=\'text/css\' /><style type=\'text/css\'>body{font-size:12px;}table {border:1px solid #000000;border-collapse: collapse;}td {border:1px solid #000000;background:white;font-size:12px;font-family: 新宋体;color: #333;</style></head><body><div><p>附件2：</p><h1 style=\'text-align:center\'><span style=\'font-size:24px\'><strong>价格认证人员统计表</strong></span></h1><p>填报单位（盖章）：<input name=\'org_name\' type=\'text\' value=\'${org_name?if_exists?html}\' /></p><p>单位代码号：<input name=\'num\' type=\'text\' value=\'${num?if_exists?html}\' /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;单位：人填&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 报日期：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 年&nbsp;&nbsp; 月&nbsp;&nbsp; 日</p><form action=\'cgFormBuildController.do?saveOrUpdate\' id=\'formobj\' method=\'post\' name=\'formobj\'><input name=\'tableName\' type=\'hidden\' value=\'${tableName?if_exists?html}\' /> <input name=\'id\' type=\'hidden\' value=\'${id?if_exists?html}\' />#{jform_hidden_field}<input type=\'hidden\' /><p>&nbsp;</p><table border=\'1\' cellpadding=\'0\' cellspacing=\'0\' style=\'width:1016px\'><tbody><tr><td rowspan=\'4\'><p>&nbsp;</p><p>&nbsp;</p><p>合计</p><p>&nbsp;</p></td><td colspan=\'6\' rowspan=\'2\'><p>&nbsp;</p><p>人数</p></td><td colspan=\'5\' rowspan=\'2\'><p>&nbsp;</p><p>学历</p></td><td colspan=\'4\' rowspan=\'2\'><p>&nbsp;</p><p>取得的（上岗）执业资格</p></td><td colspan=\'4\'><p>专业技术职称</p></td></tr><tr><td colspan=\'4\'><p>（经济系列、工程系列）</p></td></tr><tr><td colspan=\'3\'><p>在编人员</p></td><td colspan=\'2\'><p>聘用人员</p></td><td rowspan=\'2\'><p>临时(借用)人员</p></td><td rowspan=\'2\'><p>高中</p></td><td rowspan=\'2\'><p>大专</p></td><td rowspan=\'2\'><p>本科</p></td><td rowspan=\'2\'><p>研究生</p></td><td rowspan=\'2\'><p>其它</p></td><td rowspan=\'2\'><p>价格</p><p>鉴证员</p></td><td rowspan=\'2\'><p>价格</p><p>鉴证师</p></td><td rowspan=\'2\'><p>复核</p><p>裁定员</p></td><td rowspan=\'2\'><p>其它</p></td><td rowspan=\'2\'><p>初级</p></td><td rowspan=\'2\'><p>中级</p></td><td rowspan=\'2\'><p>高级</p></td><td rowspan=\'2\'><p>其它</p></td></tr><tr><td><p>本单位</p></td><td colspan=\'2\'><p>其它</p></td><td><p>长期</p></td><td><p>短期</p></td></tr><tr><td><p>A1</p></td><td><p>B1</p></td><td><p>B2</p></td><td colspan=\'2\'><p>B3</p></td><td><p>B4</p></td><td><p>B5</p></td><td><p>C1</p></td><td><p>C2</p></td><td><p>C3</p></td><td><p>C4</p></td><td><p>C5</p></td><td><p>D1</p></td><td><p>D2</p></td><td><p>D3</p></td><td><p>D4</p></td><td><p>E1</p></td><td><p>E2</p></td><td><p>E3</p></td><td><p>E4</p></td></tr><tr><td><p><input name=\'a1\' size=\'4\' type=\'text\' value=\'${a1?if_exists?html}\' /></p></td><td><p><input name=\'b1\' size=\'4\' type=\'text\' value=\'${b1?if_exists?html}\' /></p></td><td><p><input name=\'b2\' size=\'4\' type=\'text\' value=\'${b2?if_exists?html}\' /></p></td><td colspan=\'2\'><p><input name=\'b3\' size=\'4\' type=\'text\' value=\'${b3?if_exists?html}\' /></p></td><td><p><input name=\'b4\' size=\'4\' type=\'text\' value=\'${b4?if_exists?html}\' /></p></td><td><p><input name=\'b5\' size=\'4\' type=\'text\' value=\'${b5?if_exists?html}\' /></p></td><td><p><input name=\'c1\' size=\'4\' type=\'text\' value=\'${c1?if_exists?html}\' /></p></td><td><p><input name=\'c2\' size=\'4\' type=\'text\' value=\'${c2?if_exists?html}\' /></p></td><td><p><input name=\'c3\' size=\'4\' type=\'text\' value=\'${c3?if_exists?html}\' /></p></td><td><p><input name=\'c4\' size=\'4\' type=\'text\' value=\'${c4?if_exists?html}\' /></p></td><td><p><input name=\'c5\' size=\'4\' type=\'text\' value=\'${c5?if_exists?html}\' /></p></td><td><p><input name=\'d1\' size=\'4\' type=\'text\' value=\'${d1?if_exists?html}\' /></p></td><td><p><input name=\'d2\' size=\'4\' type=\'text\' value=\'${d2?if_exists?html}\' /></p></td><td><p><input name=\'d3\' size=\'4\' type=\'text\' value=\'${d3?if_exists?html}\' /></p></td><td><p><input name=\'d4\' size=\'4\' type=\'text\' value=\'${d4?if_exists?html}\' /></p></td><td><p><input name=\'e1\' size=\'4\' type=\'text\' value=\'${e1?if_exists?html}\' /></p></td><td><p><input name=\'e2\' size=\'4\' type=\'text\' value=\'${e2?if_exists?html}\' /></p></td><td><p><input name=\'e3\' size=\'4\' type=\'text\' value=\'${e3?if_exists?html}\' /></p></td><td><p><input name=\'e4\' size=\'4\' type=\'text\' value=\'${e4?if_exists?html}\' /></p></td></tr><tr><td colspan=\'20\'><p>&nbsp;</p><p>填报说明：</p><p>一、合计（A）：填报至统计截止期的本机构的人员总数。</p><p>二、人数：</p><p>在编人员：分别按照价格认证机构编制内及其它具有价格主管部门编制的实有人数填报在B1、B2栏内。</p><p>聘用人员：按照经价格主管部门或价格认证机构人事部门认可的并签订三年以上的工作合同的人员（B3）；以及没有经过价格主管部门或价格认证机构人事部门认可的签订合同少于三年的人员（B4）分别来进行统计。</p><p>临时（借用）人员（B5）：特指外聘的临时工，或者工作关系不在本单位且无长期聘用合同的借调人员等。</p><p>三、表内各栏目关系</p><p>A=B1+B2+B3+B4+B5=C1+C2+C3+C4+C5=D1+D2+D3+D4=E1+E2+E3+E4</p></td></tr></tbody></table></form></div></body></html>');
/*!40000 ALTER TABLE `ck_editor` ENABLE KEYS */;
UNLOCK TABLES;

